import { useEffect, useState } from 'react';
import axios from 'axios';

function RealTime() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('http://localhost:8001/api/fleet/realtime')
      .then(res => {
        setData(res.data);
        setLoading(false);
      });
  }, []);

  return (
    <div
      className="min-h-screen bg-cover bg-center p-8"
      style={{ backgroundImage: 'url("https://images.unsplash.com/photo-1504384308090-c894fdcc538d?auto=format&fit=crop&w=1400&q=80")' }}
    >
      <div className="bg-white bg-opacity-90 rounded-xl shadow-lg p-6 max-w-7xl mx-auto">
        <h2 className="text-3xl font-bold mb-8 text-center text-gray-800">ðŸš› Real-Time Fleet Data</h2>

        {loading ? (
          <p className="text-center text-lg">Loading data...</p>
        ) : (
          <div className="overflow-x-auto">
            <table className="w-full text-lg text-left border-collapse">
              <thead className="bg-gray-200 text-gray-700 uppercase tracking-wider">
                <tr>
                  <th className="p-4">Route</th>
                  <th className="p-4">Vehicle</th>
                  <th className="p-4">Speed (km/h)</th>
                  <th className="p-4">Total Cost (â‚¹)</th>
                </tr>
              </thead>
              <tbody className="bg-white">
                {data.map((d, i) => (
                  <tr key={i} className="border-b hover:bg-gray-100">
                    <td className="p-4">{d.route.sourceCity} â†’ {d.route.destinationCity}</td>
                    <td className="p-4">{d.vehicle.registrationNumber}</td>
                    <td className="p-4">{d.averageSpeedKmph.toFixed(1)}</td>
                    <td className="p-4">â‚¹{d.totalCost.toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default RealTime;
